    def __init__(self,gamma:float = 0.85) :
        self.gamma = gamma
        self.sample = json.loads(self.SAMPLE)

        self.startTime = datetime.now(timezone.utc)

    def get(self) :
        uptime = (datetime.now(timezone.utc) - self.startTime).seconds
        self.sample['UpTime'] = uptime

        seats = self.sample['Seats']
        for seat in seats:
            si = seats[seat]
            for k in si:
                if random.random() > self.gamma:
                    if isinstance(si[k],int) :
                        si[k] = 1 if si[k] == 0 else 0
                    elif k == "UI":
                        si[k] = self.UI_VALUES[random.randint(0,15)]
                    else:
                        pass

        return self.sample.copy()

